import React from 'react';
import diferente from './diferente.mp4';
import './Video.css';


const Video = () => {
return (
  <div className="flex justify-content" key='1'>
    <video className="w-50 vh-75 ph6" controls>
      <source src={diferente} type="video/mp4" ></source>
    </video>
  </div>
);

}

export default Video;
